    <div className="card">
      <h2>Finance</h2> <br />
      <div class="wallet">
        <aside class="left-wallet">
          <div class="wallet-head">
            <h1> My Wallets </h1>
            <div class="modal-open" onClick={openModal}>
              +
            </div>
          </div>
          '
          <div
            class="cc ' +
		  ccType +
		  ' cc-active"
          ></div>
          "
          <div class="cc-select">
            <div
              class="cc ' +
      data.type +
      '"
            ></div>
            "
          </div>
        </aside>
        <content class="right-trans">
          <h1> Current Balance </h1>
          <h4 id="balance"></h4>
          <div class="trans-list"></div>
        </content>
      </div>
      {openModal ? (
        <div class="modal">
          <div class="modal-body">
            <h3>Add a New Card</h3>
            <h5>Select a card on the left and enter the information</h5>
          </div>
        </div>
      ) : (
        <div></div>
      )}
    </div>
  );
};

export default Finance;
